import Navbar from './components/layouts/navbar';
import UserItem from './components/users/UserItem';

import './App.css';

class App extends Component{
  render() {
    return (
      <div className="App">
        <Navbar />
        <UserItem />
      </div>
    );
  }

}

export default App;
